import React from "react";
import { Router, Route, RouteHandler } from "react-router";
import { Link } from "react-router-dom";
import logo from "../logo.png";
import "../App.css";
import "../routes/routes.js";
import { render } from "@testing-library/react";
import profile from "../logo2.png";
import { Toolbar,ToolbarItem, ToolbarBackAction, ToolbarContent, ToolbarAction } from 'react-native-paper';

function homepatient() {
  return (
    <div className="App">
      <h1 className="App-h1">
        <img src={logo} className="App-logo-static" alt="logo" />
        <Toolbar>
        <ToolbarBackAction
          onPress={this._goBack}
        />
        <ToolbarContent
          title="Title"
          subtitle="Subtitle"
        />
        <ToolbarAction icon="search" onPress={this._onSearch} />
        <ToolbarAction icon="more-vert" onPress={this._onMore} />
            </Toolbar>
      </h1>
      <p className="App-p">Dobrodosli</p>
      <div className="App-home"></div>
    </div>
  );
}
export default homepatient;
